import React, { useState } from "react";
import "./TreeVisualisation.css";

const TreeVisualizer = () => {
  const [input, setInput] = useState('[1,2,3,4,5,null,8,null,null,6,7,9]');
  const [treeData, setTreeData] = useState(null);

  // Function to build the tree from a level-order array
  const buildTree = (arr) => {
    if (!arr.length) return null;

    const nodes = arr.map((value) => (value !== null ? { value, left: null, right: null } : null));

    for (let i = 0, j = 1; j < arr.length; i++) {
      if (nodes[i] !== null) {
        if (j < arr.length) nodes[i].left = nodes[j++];
        if (j < arr.length) nodes[i].right = nodes[j++];
      }
    }

    return nodes[0];
  };

  // Handle "Visualize Tree" button click
  const handleVisualize = () => {
    try {
      const parsedArray = JSON.parse(input);
      setTreeData(buildTree(parsedArray));
    } catch (error) {
      alert("Invalid input format. Please enter a valid JSON array.");
    }
  };

  // Recursive function to render the tree nodes and lines
// Recursive function to render the tree nodes and lines
const renderTree = (node, x, y, level, parentX = null, parentY = null) => {
  if (!node) return null;

  const canvasWidth = 1000; // SVG canvas width
  const verticalSpacing = 100; // Vertical spacing between levels

  // Calculate the number of nodes at the current level
  const nodesAtLevel = Math.pow(2, level); // Number of nodes at current level
  
  // Fixed horizontal spacing based on canvas width and number of nodes at current level
  const horizontalSpacing = canvasWidth / (nodesAtLevel + 1); 

  // Calculate X position for the current node based on horizontal spacing
  const nodePositionX = x + (horizontalSpacing * (nodeIndexAtLevel(level, node) - (nodesAtLevel / 2)));

  // Vertical positioning for the current node
  const childY = y + verticalSpacing;

  return (
    <>
      {/* Line connecting parent node to child */}
      {parentX !== null && (
        <line
          x1={parentX}
          y1={parentY + 20}
          x2={nodePositionX}
          y2={y - 20}
          stroke="black"
          strokeWidth="2"
        />
      )}

      {/* Circle representing the current node */}
      <g className="circle-group">
        <circle cx={nodePositionX} cy={y} r="20" className="tree-circle" />
        <text x={nodePositionX} y={y} textAnchor="middle" dy="5" fill="white" fontWeight="bold">
          {node.value}
        </text>
      </g>

      {/* Recursively render left and right children */}
      {node.left && renderTree(node.left, x - horizontalSpacing, childY, level + 1, nodePositionX, y)}
      {node.right && renderTree(node.right, x + horizontalSpacing, childY, level + 1, nodePositionX, y)}
    </>
  );
};

// Helper function to calculate the index of the node at the current level
const nodeIndexAtLevel = (level, node) => {
  let index = 0;
  const findIndex = (currentNode, currentLevel) => {
    if (!currentNode) return;
    if (currentLevel === level) {
      index++;
    }
    findIndex(currentNode.left, currentLevel + 1);
    findIndex(currentNode.right, currentLevel + 1);
  };
  findIndex(node, 0);
  return index;
};



  // Handle "Download Tree" button click
  const handleDownload = () => {
    const svgElement = document.getElementById("treeCanvas");
    const svgData = new XMLSerializer().serializeToString(svgElement);
    const blob = new Blob([svgData], { type: "image/svg+xml" });
    const url = URL.createObjectURL(blob);
    const a = document.createElement("a");
    a.href = url;
    a.download = "tree.svg";
    a.click();
  };

  return (
    <div className="tree-visualizer-container">
      <h1 className="title">Tree Visualizer</h1>

      {/* Textarea for input */}
      <textarea
        className="input-box"
        value={input}
        onChange={(e) => setInput(e.target.value)}
        placeholder="Enter a level-order array, e.g., [1,2,3,4,5,null,8,null,null,6,7,9]"
      />

      {/* Buttons for actions */}
      <div className="button-container">
        <button className="visualize-button" onClick={handleVisualize}>
          Visualize Tree
        </button>
        <button className="download-button" onClick={handleDownload}>
          Download Tree
        </button>
      </div>

      {/* Canvas for rendering the tree */}
      <div className="canvas-container">
        <svg id="treeCanvas" className="tree-canvas" viewBox="0 0 1000 600">
          {treeData && renderTree(treeData, 500, 50, 0)} {/* Root starts at center */}
        </svg>
      </div>
    </div>
  );
};

export default TreeVisualizer;
